// Avoid `console` errors in browsers that lack a console.
(function() {
    var method;
    var noop = function () {};
    var methods = [
        'assert', 'clear', 'count', 'debug', 'dir', 'dirxml', 'error',
        'exception', 'group', 'groupCollapsed', 'groupEnd', 'info', 'log',
        'markTimeline', 'profile', 'profileEnd', 'table', 'time', 'timeEnd',
        'timeStamp', 'trace', 'warn'
    ];
    var length = methods.length;
    var console = (window.console = window.console || {});

    while (length--) {
        method = methods[length];

        // Only stub undefined methods.
        if (!console[method]) {
            console[method] = noop;
        }
    }
}());

// Place any jQuery/helper plugins in here.
(function(){

    $.Browser = {
        defaults: {
            title:             'Choose Directory',
            url:               '/browser/',
            showFiles:         false,
            autocompleteURL:   '/localhost:8085/browser/complete'
        }
    };

    var fileBrowserDialog  = null;
    var currentBrowserPath = null;
    var currentRequest     = null;

    function browse(path, endpoint, showFiles) {
        
        if(currentBrowserPath == path)
            return;
        console.log(path)
        currentBrowserPath = path;
        
        if(currentRequest)
            currentRequest.abort();
        
        currentRequest = $.getJSON(endpoint, { path: path, showFiles: showFiles}, function(data){
            $('.modal-body',fileBrowserDialog).empty();
            var first_val = data[0];
            var i = 0;
            data = jQuery.grep(data, function(value) {
                return i++ != 0;
            });
            $('h3', fileBrowserDialog).html(first_val.current_path);
            list = $('<ul class="nav nav-stacked nav-list">').appendTo('.modal-body',fileBrowserDialog);
            $.each(data, function(i, entry) {
                
                link = $("<a href='javascript:void(0)' />").text(entry.name)
                if(entry.isPath)
                    link.click(function(){ browse(entry.path, endpoint, showFiles); });
                else{
                    link.click(function(){
                        currentBrowserPath = entry.path;
                        $('li', list).removeClass('active')
                        $(this).parent().addClass('active')
                    });
                }
                    
                if(entry.isPath){
                    $('<i class="icon-folder-close front"></i>').prependTo(link);
                    if(entry.name == '..')
                        $('<i class="icon-chevron-left pull-right"></i>').appendTo(link)
                    else
                        $('<i class="icon-chevron-right pull-right"></i>').appendTo(link)

                    link.hover(
                        function(){jQuery("i.front", this).addClass("icon-folder-open");},
                        function(){jQuery("i.front", this).removeClass("icon-folder-open"); }
                    );
                }else{
                    $('<i class="icon-file-alt front"></i>').prependTo(link);
                }
                var li = $('<li>').append(link)
                if(entry.path == path){
                    li.addClass('active')
                }
                
                li.appendTo(list);
            });
        });
    }

    $.fn.nFileBrowser = function(callback, options){
        
        options = $.extend({}, $.Browser.defaults, options);
        
        // make a fileBrowserDialog object if one doesn't exist already
        if(!fileBrowserDialog) {
        
            // set up the bootstrap dialog
            fileBrowserDialog = $('<div id="fileBrowserDialog" class="modal hide fade"><div class="modal-header"><button type="button" class="close" data-dismiss="modal" aria-hidden="true">&times;</button><h3 id="myModalLabel"></h3></div><div class="modal-body"></div></div>').appendTo('body')
            fileBrowserDialog.append('<div class="modal-footer"><button class="btn" data-dismiss="modal">Close</button><button class="btn btn-primary" data-dismiss="modal">Set Path</button></div>')
            $('.btn.btn-primary[data-dismiss="modal"]', fileBrowserDialog).click(function(){
                callback(currentBrowserPath, options);
            });
        }
        // set up the browser and launch the dialog
        if (options.initialDir)
            initialDir = options.initialDir;
        else
            initialDir = '';
        browse(initialDir, options.url, options.showFiles)
        fileBrowserDialog.modal();

        return false;
    };

    $.fn.fileBrowser = function(options){
        options = $.extend({}, $.Browser.defaults, options);

        // text field used for the result
        options.field = $(this);
        
        if(options.field.autocomplete && options.autocompleteURL) {
            options.field.autocomplete({ 
                source: options.autocompleteURL,
                open: function(event, ui) { 
                    $(".ui-autocomplete li.ui-menu-item a").removeClass("ui-corner-all");
                    $(".ui-autocomplete li.ui-menu-item:odd a").addClass("ui-menu-item-alternate");
                }
            });
        }
        
        callback = function(path, options){
            // store the browsed path to the associated text field
            options.field.val(path);
        
        }

        initialDir = options.field.val() || '';
        
        options = $.extend(options, {initialDir: initialDir})
        
        if(options.showFiles)
            buttonText = 'Browse file&hellip;'
        else
            buttonText = 'Browse folder&hellip;'
            
        // append the browse button and give it a click behavior
        return options.field.addClass('fileBrowserField')
        .wrap('<div class="input-append">')
        .after($('<input type="button" value="' + buttonText + '" class="fileBrowser btn" /></div>')
        .click(function(){
            $(this).nFileBrowser(callback, options);
            return false;
        }));
    };
})();

(function(){
    $.fn.youtube = function(options) {
        return this.each(function() {
          var regex = /youtu(be\.com\/watch\?v=|\.be\/)([A-Za-z0-9._%-]*)/;
          regex.exec($(this).attr('href'))
          $(this).attr('href', 'http://www.youtube.com/embed/'+ RegExp.$2 + '?autoplay=1');
        });
      }
})();

